import React,{Component} from "react";
import '../index.css'

import Header from './Header'
import SearchBar from './SearchBar';

class App extends Component{
    constructor(){
        super()
    }

    render(){
        return(
            <>
            <Header />
            <SearchBar />
            </>
        )
    }
    
}

export default App;
